import React from "react";

function Cards(props) {
  return (
    <div>
      {console.log(props.actual, "oye yahan dekho")}
      {props.actual === undefined ? (
        <div className="cards">
          <div className="card">
            <img src={props.imgsrc} alt="my pic" className="card_img" />
            <div className="card_info">
              <span className="card_category">Rs : {props.price}</span>
              <h3 className="card_title">Ratings : {props.ratings}</h3>
              <h3 className="card_title">Distance : {props.distance}</h3>
              <a href={props.link}>
                <button>call 7988092742</button>
              </a>
            </div>
          </div>
        </div>
      ) : props.actual >= props.distance ? (
        <div className="cards">
          <div className="card">
            <img src={props.imgsrc} alt="my pic" className="card_img" />
            <div className="card_info">
              <span className="card_category">Rs : {props.price}</span>
              <h3 className="card_title">Ratings : {props.ratings}</h3>
              <h3 className="card_title">Distance : {props.distance}</h3>
              <a href={props.link}>
                <button>call 7988092742</button>
              </a>
            </div>
          </div>
        </div>
      ) : (
        console.log("please")
      )}
    </div>
  );
}
export default Cards;
